subSubSection.paragraph:
Egg (

Fig. 33

). Capsule elongated and almost cylindrical, equal height and width, two times longer than wide. Capsule pale brown with some dark brown patches, surface covered by a fine and irregular net-like structure of carinae with smooth areas in between. Except for the ventral area, surface of the egg bearing several spine-like setae. Micropylar plate elongate, lancet-like and of almost 1/2 the length of capsule, 3 times longer than wide; irregularly raised elevations and setae in its centre. Micropylar cup small and connected to a short median line, running towards polar area. Operculum ovoid and flat, positioned in 50° angle towards the dorsal area; surface roughly structured, with rising spine-like setae in the centre.
